import Data from "../../pages/Accueil/data.json"

function Caroussel () {
    const arrayImagesAppartement = []
    Data.map((logement) =>
        arrayImagesAppartement.push(logement.pictures)
    )

    arrayImagesAppartement.map((image) => 
        <img src={image.picture} alt={image.title} />
    )

    return arrayImagesAppartement
}

export default Caroussel
